import React from "react";
import { View, Text, StyleSheet, TouchableOpacity} from "react-native";


export default function Listagem_pets({ data, deleteItem, editItem, navigation, props}) {
    return (
        <View>
            <View style={styles.container}>
                <Text style={styles.text}>Protetor: {data.protetor}</Text>
                <Text style={styles.text}>Tipo: {data.tipo}</Text>
                <Text style={styles.text}>Nome: {data.nome}</Text>
                <Text style={styles.text}>Porte: {data.porte}</Text>
                <Text style={styles.text}>Ra√ßa: {data.raca}</Text>
                <Text style={styles.text}>Idade: {data.idade}</Text>
             </View>

            <View style={styles.areaBtn}>
                <TouchableOpacity style={styles.botao, {backgroundColor: "red"}} onPress={()=> deleteItem(data.id)}>
                     <Text style={styles.botaoText}>Deletar</Text>
                 </TouchableOpacity>
                 <TouchableOpacity style={styles.botao, {backgroundColor: "#1d75cd"}} onPress={props.navigation.navigate('Listar Protetores'), editItem(data.id)}>
                    <Text style={styles.botaoText}>Editar</Text>
                </TouchableOpacity>
            </View>
        </View>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1, marginTop: 10,
        marginBottom: 5,
        padding: 10,
        backgroundColor: '#4F7063'
    },
    text: {
        color: '#FFF', fontSize: 17

    },
    areaBtn: {
        alignItems: "center",
        flexDirection: "row",
        marginBottom:15,
        marginLeft:15,
        marginRight:15,
        justifyContent: "space-between",
      },
      botao: {
        height:55,
        justifyContent: "center",
        alignItems: "center",
        padding: 15,
        borderRadius: 5,
      },
      botaoText: {
        fontSize: 22,
        color: "#FFF",
      },
});
